import React from 'react';
import Home from './Home'
import About from './About'
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";


const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
   
  },
  {
    path: "/about-us",
    element: <About />
   
  },
]);


export default function Content() {
  return (
    <RouterProvider router={router} />
  )
}
